package com.onerainbow.module.account.model

import com.onerainbow.lib.database.OneRainbowDatabase
import com.onerainbow.lib.database.entity.UserEntity

/**
 * description ： 登录的Model层
 * author : HI-IR
 * email : qq2420226433@outlook.com
 * date : 2025/7/23 11:34
 */
class AccountModel {
    private val userDao by lazy {
        OneRainbowDatabase.getDatabase().userDao()
    }
    //默认头像
    val DEFAULT_AVATAR = "data:image/jpeg;base64,"
    /**
     * 注册账户，输入账号密码
     * 注册成功则在onSuccess中返回username
     * 失败则在onError中返回信息
     */
    suspend fun registeredAccount(username: String, password: String,onSuccess: (String)->Unit,onError: (String)->Unit){
        try {
            val result = userDao.insertUser(UserEntity(username,password,DEFAULT_AVATAR))
            if (result == -1L){
                onError("用户名重复")
                return
            }
            onSuccess(username)
        }catch (e: Exception){
            onError(e.message?:"未知错误")
        }
    }

    /**
     * 验证密码
     */
    suspend fun verifyPassword(username: String,password: String,onSuccess: (String)->Unit,onError: (String)->Unit){
        try {
            val storedPassword =  userDao.getPassword(username)
            if (storedPassword == null){
                onError("没有找到该账户，请注册")
                return
            }

            if (storedPassword == password){
                onSuccess(username)
                return
            }

            onError("密码错误")
        }catch (e: Exception){
            onError(e.message?:"未知错误")
        }
    }

}